
app.controller("bureau_ctrl",['$scope','$rootScope','$controller','$location','$http','$translate','$compile','$interval','$msThemes', '$mdSidenav','$mdDialog', function($scope,$rootScope,$controller,$location,$http,$translate,$compile,$interval,$msThemes,$mdSidenav,$mdDialog){

	$scope.app = {
		theme : welcome.configs.theme,
		backgroundImage : "data:image/jpeg;base64,",
		backgrounds : [
			"data:image/png;base64,"
		],
		init: function(){
			welcome.closeWindowsLoader();
		},
		openMenu : function(){
			if(welcome.templates.startup)
				$rootScope.appRoot.addTemplate(welcome.templates.startup);
		}

	}

}]);

